import React from 'react';
import "./Navigator.css";
import { Link } from "react-router-dom";


const Navigator = () => {
  return (
    <nav className="Navigator">
      <ul className="Navigator_ul">
        
        <li>
          <Link to="/">HOME</Link>
        </li>
        
        <li>
          <Link to="/">ART</Link>
        </li>
        
        <li>
          <Link to="/">REGISTER</Link>
        </li>
        
        <li>
          <Link to="/">LOGIN</Link>
        </li>
      
      </ul>
    </nav>
  
  )
}

export default Navigator;
